 that the trouble could have been avoided, he is to be observed for heretical tendencies. If the suspect has yet not shown any heretic opinion, ask him why he thinks that the GODS would ALLOW that such things are happening. If he claims that he doesn\'t know, it is implied that he doubts this godly decision and is to be observed for heretical tendencies. If he comes up with an explanation that suggests that the gods lack the power to prevent that such a thing happens, than he is to be observed for heretical tendencies as well. If he answers that only the gods know the answer or that the gods had some plausible reason, like testing humanity, he may have no heretical tendencies at all.\nIII\nIf the suspect claims that he has no trouble at all, ask him if he thinks that the lack of trouble is explained by the FORESIGHT of the AUTHORITIES. If he denies, he is to be observed for heretical tendencies. If he agrees, ask him if he thinks that it is ALSO for the GODS\' will that he has no trouble. If he disagrees, he is to be observed for heretical tendencies. If the subject does not show any suspicious b haviour at this point, ask him if he thinks that any TROUBLE will arise in the near FUTURE. If he negates, he obviously will become lax in the line of his duty and he is to be observed for heretical tendencies. If he confirms that trouble might arise, continue as in paragraph II.'),(242,181,8,25384,5,''),(242,182,8,23782,1,'#\0Pack Imbuement Skill Magic package.'),(242,183,8,25386,10,'\n'),(242,184,14,23782,1,' \0Pack Imbuement Dano Ice package.'),(242,185,17,24637,1,''),(242,186,17,7404,1,''),(242,187,17,24637,1,''),(242,188,17,2149,2,''),(242,189,17,7451,1,''),(242,190,17,22533,5,''),(242,191,17,2666,3,''),(242,192,17,7407,1,''),(242,193,17,11306,1,''),(242,194,17,7407,1,''),(242,195,17,22396,3,''),(242,196,17,22532,32,' '),(242,197,17,28999,75,'K'),(242,198,17,8910,1,''),(242,199,17,10221,5,'\0'),(242,200,17,8871,1,''),(242,201,17,8871,1,''),(242,202,17,