INSERT INTO `z_forum` VALUES (3,3,1590762519,1,0,24,39,93,'Disponibilizamos um servidor do [b]Discord[/b] para interagirmos melhor. Se quizer participar, basta acessar o servidor usando este link: [b]https://discord.gg/fbtd9Ux[/b]','Discord do servidor !',0,1590762519,39,1590783760,'170.80.194.66',0,''),(6,6,1592268128,1,0,178,79,141,'[img]http://honera.com.br/images/honerab1.png[/img]\r\n</br><center><b></br>Sejam bem vindos, estamos anciosos por sua presena no nosso servidor.</b></center>\r\n</br>\r\n</br>\r\n\r\n<b>Server Features: </b></br></br>\r\n\r\n\r\n* [b][JOGABILIDADE] Skill Stages[img]https://www.tibiawiki.com.br/images/3/37/Physical_Damage_Icon.gif[/img], Experience Stages [img]https://www.tibiawiki.com.br/images/3/37/Physical_Damage_Icon.gif[/img]:[/b]  <a href=\"http://honera.com.br/?subtopic=serverinfo\">Server info</a> </br> \r\n* [b][STORE BOOSTS] Experience Boost[img]https://www.tibiawiki.com.br/images/8/86/Haste_Flash_Icon.gif[/img], Regen Boost[img]https://www.tibiawiki.com.br/images/7/79/Strengthened_Flash_Icon.gif[/img], Skills Boost[img]https://www.tibiawiki.com.br/images/3/37/Physical_Damage_Icon.gif[/img]:[/b]  <a href=\"http://honera.com.br/?subtopic=serverinfo\">Server info</a> </br> \r\n\r\n* [b]Online Points[/b][img]https://www.tibiawiki.com.br/images/f/ff/Achievement.gif[/img] Nos ajude permanecendo online e ganhe coins por isso!!![i](Ganhe pontos que podem ser trocados por coins, toda sexta feira no NPC Honera, perto do temploe de Thais)[/i]</br>\r\n\r\n* [b]Transferencia de addons e outfits[/b] ao comprar a [b]troca de sexo[/b] da Store. [img]https://www.tibiawiki.com.br/images/e/e8/Sex_Change_Icon.png[/img]</br>\r\n* [b][COMBOS][ITENS DE IMBUEMENT][/b] na store [i](Vendidos em Packs, isso mesmo.)[/i][img]https://www.tibiawiki.com.br/images/1/1f/Parcel.gif[/img]</br>\r\n\r\n[b]* Dawnport revisada. (Skills +rapidos)[/b] [img]https://www.tibiawiki.com.br/images/1/12/Woodling.gif[/img]</br>\r\n<center>[img]http://honera.com.br/images/honera/adawn3.png[/img]</center></br>\r\n Para ir para main atraves de dawnport primeiramente pegue o level 8 e apos fale com a npc [b]Oressa[/b]: [i](hi, choose, yes)[/i] apos a porta correspondente a sua vocacao estara liberada. [i] (nao esqueca de pegar os itens iniciais no bau) [/i]</br>\r\n\r\n[b]* Rookgaard revisada. (lento)[/b][img]https://www.tibiawiki.com.br/images/4/42/Spike_Sword.gif[/img]</br>\r\n\r\n[b]* Autoloot por modal window com sistema de Backpack. [/b]</br>\r\nBuscar loots do monstro e selecionar a backpack:\r\n[i]!add rat[/i]</br><center>\r\n[img]http://honera.com.br/images/honera/a10.png[/img]\r\n[img]http://honera.com.br/images/honera/a12.png[/img]\r\n[img]http://honera.com.br/images/honera/a13.png[/img]\r\n[img]http://honera.com.br/images/honera/a14.png[/img]\r\n</center></br>\r\nRemovendo loots:\r\n[i]Pelo menu do !add, ou opcionalmente !autoloot[/i]</br>\r\n<center>\r\n[img]http://honera.com.br/images/honera/a15.png[/img][img]http://honera.com.br/images/honera/a16.png[/img]\r\n</center>\r\n\r\n\r\n* Launcher AutoUpdater. (Baixe nosso client e se mantenha atualizado)</br>','Novidades!',0,1592268128,79,1599882192,'186.251.86.19',0,''),(7,7,1600026941,1,0,26,79,141,'<b><center>Ouvimos a sugesto dos players e no proximo SS a regen vai DOBRAR, e o tempo de regen Cair pela METADE.</center></b>\r\n\r\n<center><b>Baixem o novo client!</b> Caso nao esteja conseguindo conectar.\r\n[img]https://www.tibiawiki.com.br/images/a/a1/Marid.gif[/img]</center></br>\r\n\r\nGrupo o Whatsapp: https://chat.whatsapp.com/B702jGScpIF6PwbEXDEfso','Novo Client, Nova Regen !!!',0,1600026941,79,1600560776,'186.251.86.44',1,'');
/*!40000 ALTER TABLE `z_forum` ENABLE KEYS */;
